import { useState, useEffect } from "react";
import api from "../../api/axios";

export default function ProjectForm() {
  const [formData, setFormData] = useState({
    name: "",
    ship: "",
    daily_rate: "",
    start_date: "",
    end_date: "",
  });
  const [ships, setShips] = useState([]);
  const [submitting, setSubmitting] = useState(false);
  const [canCancel, setCanCancel] = useState(false);
  const [lastCreatedId, setLastCreatedId] = useState(null);

  useEffect(() => {
    const fetchShips = async () => {
      try {
        const res = await api.get("/ships/");
        const data = Array.isArray(res.data)
          ? res.data
          : res.data.results || [];
        setShips(data);
      } catch (err) {
        console.error("Error fetching ships", err);
      }
    };
    fetchShips();
  }, []);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prev) => ({ ...prev, [name]: value }));
  };

  const submit = async (e) => {
    e.preventDefault();
    setSubmitting(true);
    try {
      const res = await api.post("/projects/", formData);
      alert("Project created");
      setFormData({
        name: "",
        ship: "",
        daily_rate: "",
        start_date: "",
        end_date: "",
      });
      setCanCancel(true);
      setLastCreatedId(res.data?.id || null);
    } catch (err) {
      console.error(err);
      alert("Error: " + (err.response?.data?.detail || err.message));
    } finally {
      setSubmitting(false);
    }
  };

  return (
    <div
      className="min-h-screen bg-cover bg-center p-6"
      style={{
        backgroundImage: `url('https://images.unsplash.com/photo-1552664730-d307ca884978?w=1920&h=1080&fit=crop')`,
      }}
    >
      <div className="absolute inset-0 bg-black/30"></div>
      <form
        onSubmit={submit}
        className="relative max-w-lg mx-auto space-y-4 p-6 bg-white shadow-lg rounded"
      >
        <h2 className="text-xl font-semibold">Add Project</h2>

        <select
          name="ship"
          value={formData.ship}
          onChange={handleChange}
          className="w-full border p-2 rounded"
          required
        >
          <option value="">Select Ship</option>
          {ships.map((s) => (
            <option key={s.id} value={s.id}>
              {s.name}
            </option>
          ))}
        </select>

        <input
          name="name"
          placeholder="Project Name"
          className="w-full border p-2 rounded"
          value={formData.name}
          onChange={handleChange}
          required
        />

        <input
          name="daily_rate"
          placeholder="Daily Rate"
          type="number"
          className="w-full border p-2 rounded"
          value={formData.daily_rate}
          onChange={handleChange}
          required
        />

        <input
          name="start_date"
          type="date"
          className="w-full border p-2 rounded"
          value={formData.start_date}
          onChange={handleChange}
          required
        />

        <input
          name="end_date"
          type="date"
          className="w-full border p-2 rounded"
          value={formData.end_date}
          onChange={handleChange}
        />

        <div className="flex gap-3">
          <button
            type="submit"
            disabled={submitting}
            className="flex-1 bg-blue-600 text-white py-2 rounded"
          >
            {submitting ? "Saving..." : "Save"}
          </button>
          <button
            type="button"
            onClick={async () => {
              if (!lastCreatedId) { setCanCancel(false); return; }
              try {
                await api.delete(`/projects/${lastCreatedId}/`);
                alert('Project deleted');
                setCanCancel(false);
                setLastCreatedId(null);
              } catch (err) {
                console.error('Cancel project failed', err);
                alert('Cancel failed: ' + (err.response?.data?.detail || err.message));
              }
            }}
            disabled={!canCancel}
            className={`px-4 py-2 rounded ${canCancel ? 'bg-red-500 text-white' : 'bg-gray-200 text-gray-500 cursor-not-allowed'}`}
          >
            âœ– Cancel
          </button>
        </div>
      </form>
    </div>
  );
}
